Why We Love Cats and Dogs (HD)

Nature, Sociopolitical Documentary hosted by Ellen Goosenberg Kent, published by PBS broadcasted as part of PBS Nature series in 2009 - English narration


Information
------------------------------

Ask people and they immediately know they're either a dog person or a cat person. What is this all about? This film launches into the great divide between dogs and cats and just what draws people to these two polarizing pets. Funny, touching and provocative, NATURE asks how well we really know our best friends and why we love them so much.

